import { Box, Grid, Paper, Stack, Typography} from "@material-ui/core";
import { indigo, pink} from '@material-ui/core/colors';


function Skills() {
    return (
        <Box component={Grid} container overflow='auto' alignSelf='center' width='60rem' backgroundColor='re' spacing={1}>
            <Grid item width={5/8}>
                <Paper sx={{backgroundColor:'transparent'}}>
                    <Typography mx='auto' fontSize='1.7rem' fontWeight='600' backgroundColor='white' width='fit-content' borderRadius='0.5rem' p={1} color={indigo[900]}> 
                        Hard Skills
                    </Typography>
                </Paper>
            </Grid>
            <Grid item width={3/8}>
            <Typography mx='auto' fontSize='1.7rem' fontWeight='600' backgroundColor='white' width='fit-content' borderRadius='0.5rem' p={1} color={pink[900]}> 
                        Soft Skills
                    </Typography>
            </Grid>
        </Box>
    )
}

export default Skills;
